    <div>
        <h1>Learning usememo</h1>
        <button onClick={()=>setAdd(add + 1)}>Addition</button>
        <br/>
        <button onClick={()=>setSub(100 - 1)}>subtraction</button>
      
    </div>
  )
}

export default Usem
